import {BrowserRouter as Switch, Route} from 'react-router-dom'
import CardPayment from './CardPayment'
import ApplePayment from './ApplePayment'

const App = () => {
    return(
        <Switch>
            <Route path = "/" exact>
                <CardPayment/>
                <ApplePayment/>
            </Route>
        </Switch>
    )
}

export default App;
